INSERT INTO public."Question" (id, "assignmentId", "quizId", teks, jenis, poin, "jawabanBenar", pembahasan) VALUES ('qst_849a958a-2990-49cb-8c09-f702562bc87b', 'asn_bfa98bb9-718f-4545-8682-7fa5317611ad', NULL, 'Diketahui matriks A = [[2, 3], [1, 4]] dan B = [[5, 6], [7, 8]]. Hitunglah A + B!', 'ESSAY', 25, NULL, 'A + B = [[2+5, 3+6], [1+7, 4+8]] = [[7, 9], [8, 12]]');
INSERT INTO public."Question" (id, "assignmentId", "quizId", teks, jenis, poin, "jawabanBenar", pembahasan) VALUES ('qst_8017d84e-bc42-4cd5-9ad5-6e1a4fa12ba1', 'asn_bfa98bb9-718f-4545-8682-7fa5317611ad', NULL, 'Tentukan determinan dari matriks C = [[3, 2], [1, 4]]!', 'SHORT_ANSWER', 25, '10', 'det(C) = (3×4) - (2×1) = 12 - 2 = 10');
INSERT INTO public."Question" (id, "assignmentId", "quizId", teks, jenis, poin, "jawabanBenar", pembahasan) VALUES ('qst_8368021c-f13e-49d6-a431-4c494a1d74e1', 'asn_bfa98bb9-718f-4545-8682-7fa5317611ad', NULL, 'Jika matriks D memiliki determinan = 0, maka matriks D memiliki invers', 'TRUE_FALSE', 25, 'false', NULL);
INSERT INTO public."Question" (id, "assignmentId", "quizId", teks, jenis, poin, "jawabanBenar", pembahasan) VALUES ('qst_e2e1bb0f-710b-49f2-bc70-81bfb11fb7c3', 'asn_bfa98bb9-718f-4545-8682-7fa5317611ad', NULL, 'Hitunglah hasil perkalian matriks [[1, 2], [3, 4]] × [[2, 0], [1, 3]]!', 'ESSAY', 25, NULL, 'Hasil = [[1×2+2×1, 1×0+2×3], [3×2+4×1, 3×0+4×3]] = [[4, 6], [10, 12]]');